import React from 'react';

export default class Home extends React.Component {
  constructor(props: any) {
    super(props);
  };

  render() {
    return (
      <div className="home">
        <h1 className="article-title">Discover</h1>
        <p>
        Anything you want to do you can do here.
        You can do anything here - the only pre-requisite is that it makes you happy. It's a super day, so why not make a beautiful sky? Let's make some happy little clouds in our world.
        The first step to doing anything is to believe you can
        do it. See it finished in your mind before you ever start. This is your world, whatever makes you happy you can put in it. Go crazy. But we're not there yet, so we don't need to worry about it. The little tiny Tim easels will let you down.
        Here's something that's fun. Just pretend you are a
        whisper floating across a mountain. Now then, let's play.
        Isn't it great to do something you can't fail at?
        </p>
      </div>
    );
  }
}
